const generateName = (gender, withPatronymic=false) => {
  const namesByLanguage = names.ru;
  if (!namesByLanguage) {
    return '';
  }

  const namesByGender = namesByLanguage[gender];
  if (!namesByGender) {
    return '';
  }

  const name = choice(namesByGender.name);
  const patronymic = choice(namesByGender.patronymic);
  const surname = choice(namesByGender.surname);

  return withPatronymic
    ? `${name} ${patronymic} ${surname}`
    : `${name} ${surname}`;
};

export default generateName;
